import { Handle, Position } from 'reactflow';

export function OutputNode() {
  return (
    <div className="node output-node">
      <strong>Output Node</strong>
      <div>Output Value</div>

      {/* INPUT handle */}
      <Handle
        type="target"
        position={Position.Left}
      />
    </div>
  );
}
